\u0412\u043e\u043f\u0440\u043e\u0441 13.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Слуга спас хозяина от разъяренного быка, отвлекая того своим плащом;
если бык во время корриды проявил исключительную смелость, ему могут
сохранить жизнь.

\u0412\u043e\u043f\u0440\u043e\u0441 14.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Речь идет о знаменитом кинофестивале, главными призами которого являются
"Золотой лев" (лучшему фильму) и "Серебряный лев" (лучшему режиссеру);
упомянутые режиссеры в разные годы получали этих "Львов".

Сталин несколько раз отказывался принять звание генералиссимуса;
Рокоссовский сказал: "Товарищ Сталин, вы маршал и я маршал, вы меня
наказать не сможете!".
